// Global Image Assets Registry
// Images are stored as base64 data URLs for use without a server
// Use the Image to Base64 Converter tool at: tools/imageToBase64Converter.html

const IMAGE_ASSETS = {
    // Add your images here using the converter tool
    // Format: imageName: 'data:image/png;base64,...',
    
    // Example:
    // shipImage: 'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAA...',

        island: 'data:image/png;base64,',

        water2: 'data:image/jpeg;base64,',

        water: 'data:image/jpeg;base64,',

        ocean2: 'data:image/jpeg;base64,',

        ocean: 'data:image/jpeg;base64,',

        shipImage: 'data:image/png;base64,',
};

// Utility function to create a texture from an image asset
function createTextureFromAsset(scene, assetKey, textureName) {
    if (!IMAGE_ASSETS[assetKey]) {
        console.warn(`Image asset '${assetKey}' not found in IMAGE_ASSETS`);
        return false;
    }
    
    return new Promise((resolve) => {
        const img = new Image();
        img.onload = () => {
            try {
                scene.textures.create(textureName || assetKey, img);
                console.log(` Texture '${textureName || assetKey}' created from asset '${assetKey}'`);
                resolve(true);
            } catch (err) {
                console.error(`Failed to create texture: ${err}`);
                resolve(false);
            }
        };
        img.onerror = () => {
            console.error(`Failed to load image asset: ${assetKey}`);
            resolve(false);
        };
        img.src = IMAGE_ASSETS[assetKey];
    });
}

// Utility function to get a data URL for an image asset
function getImageDataUrl(assetKey) {
    if (!IMAGE_ASSETS[assetKey]) {
        console.warn(`Image asset '${assetKey}' not found in IMAGE_ASSETS`);
        return null;
    }
    return IMAGE_ASSETS[assetKey];
}

console.log(' Image Assets loaded. Total images:', Object.keys(IMAGE_ASSETS).length);

// Make IMAGE_ASSETS globally accessible
window.IMAGE_ASSETS = IMAGE_ASSETS;
